import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h2>恆通經銷車用零件管理系統</h2>
      <Link to="/inventory">進入庫存管理</Link>
      <br />
      <Link to="/admin">
        <button style={{ marginTop: 16 }}>進入後台</button>
        <Link to="/shipping"><button style={{ marginLeft: 16 }}>出貨統計</button></Link>
      </Link>
    </div>
  );
}
export default Home;
